Blockly.Msg.LANG_TEXT_COMPARE_TOOLTIP_EQUAL="Verifica se le righe di testo sono identiche, cioè se hanno gli stessi\n caratteri nello stesso ordine. Questo è diverso da = come viene inteso solitamente\n qualora le stringhe di testo siano numeri: 123 e 0123 sono =\n ma non sono = come testo.";Blockly.Msg.LANG_TEXT_COMPARE_TOOLTIP_GT="Verifica se il testo1 è lessicograficamente successivo al testo 2.\n se un testo è il prefisso dell'altro, il testo più breve è considerato più piccolo.\n I caratteri maiuscoli precedono i caratteri minuscoli.";
Blockly.Msg.LANG_TEXT_TRIM_TOOLTIP="Restituisce una copia della stringa di testo con\n gli spazi iniziali e finali rimossi.";Blockly.Msg.LANG_TEXT_STARTS_AT_TOOLTIP="Restituisce la posizione di inizio del brano specificato.\n 1 indica l'inizio del testo. Restituisce 0 se il\n brano non è presente nel testo.";Blockly.Msg.LANG_TEXT_SPLIT_TOOLTIP_SPLIT_AT_FIRST='Divide il testo in due pezzi in base alla prima corrispondenza rilevata \n del testo \'a\' come punto di divisione, e crea una lista contenente i due tronconi di testo \n prima e dopo il punto di divisione. \n Dividere "mela,banana,ciliegia,cibo per gatti" con una virgola come punto di divisione \n crea una lista di due elementi: il primo testo sarà "mela" ed il secondo testo sarà \n "banana,ciliegia,cibo per gatti". \n da notare che la virgola dopo "mela" non apparirà nel risultato, \n perchè rappresenta il punto di divisione.';
Blockly.Msg.LANG_TEXT_SPLIT_TOOLTIP_SPLIT_AT_FIRST_OF_ANY='Divide il testo in una lista di due elementi, usando la prima ricorrenza di un qualunque elemento \n nella lista \'a\' come punto di divisione. \n\n Dividendo "Io amo le mele banane angurie arance." con la lista “(ba me)” risulterà \n una lista di due elementi, come primo "Io amo le" e come secondo \n "le banane angurie arance."';Blockly.Msg.LANG_TEXT_SPLIT_TOOLTIP_SPLIT='Divide il testo in più pezzi usando il testo \'a\' come punto di divisione e produce una lista con i risultati. \n Dividendo "uno,due,tre,quattro" ad ogni "," (virgola) risulterà una lista “(uno due tre quattro)”. \n Dividendo "una-patata,due-patate,tre-patate,quattro" ad ogni "-patata,", verrà prodotta la lista “(uno due tre quattro)”.';
